import { Slider, SliderTrack, SliderFilledTrack, SliderThumb, Box } from "@chakra-ui/react";
import { useState } from "react";

const positions = ["Position 1", "Position 2", "Position 3", "Position 4", "Position 5"];

function SliderBar() {
  const [position, setPosition] = useState(positions[0]);

  function handlePositionChange(value) {
    setPosition(positions[value]);
  }

  return (
    <Box>
      <Slider defaultValue={0} min={0} max={4} step={1} onChange={handlePositionChange}>
        <SliderTrack>
          <SliderFilledTrack />
        </SliderTrack>
        <SliderThumb />
      </Slider>
      <Box textAlign="center" mt={4}>
        {position}
      </Box>
    </Box>
  );
}
